pragma solidity ^0.4.23;
pragma experimental ABIEncoderV2;


contract Okonomi {
    struct Post {
        uint postId;
        uint like;
        uint dislike;
        string station;
        string fromLine;
        string toLine;
    }

    Post[] public posts;

    struct Step {
        uint postId;
        uint stepId;
        string comment;
        string photo;
    }

    Step[] public steps;

    constructor() public {
        steps.push(Step(0, 0, "firstComment", "firstPhot"));
        steps.push(Step(0, 1, "secondComment", "secondPhot"));
        steps.push(Step(0, 2, "thirdComment", "thirdPhot"));

        posts.push(Post(0, 0, 0, "溜池山王", "銀座線", "南北線")); 
    }

    function search(string _station, string _toLine, string _fromLine) public returns (Post) {
        for (uint i = 0; i < posts.length; i++) {
            if (keccak256(_station) == keccak256(posts[i].station)
                && keccak256(_fromLine) == keccak256(posts[i].fromLine)
                && keccak256(_toLine) == keccak256(posts[i].toLine)) {

                return posts[i];

            }
        }
    }


}
